import styled from "styled-components";
import HomeRanking from "../components/HomeRanking";
import MainList from "../components/MainList";
import { useEffect, useState } from "react";
import { fetchNums, fetchArticles } from "../store/api";

const Main = styled.div``;

const Home = () => {
  const [state, setState] = useState([]);
  const url = "https://hacker-news.firebaseio.com/v0/topstories.json";
  useEffect(() => {
    (async () => {
      const json = await fetchNums(url);
      const objArr = await fetchArticles(json, 5);
      console.log(objArr);
      setState(objArr);
    })();
  }, []);
  console.log(state);
  return (
    <Main>
      <HomeRanking objArr={state}></HomeRanking>
      <MainList></MainList>
    </Main>
  );
};

export default Home;
